Sinoptik.bg - прогноза за времето, навсякъде и по всяко време.

Сайтът предоставя детайлна десетдневна прогноза за 80 000 локации в цял свят.

На Sinoptik.bg можете да се информирате и за условията за ски в най-големите български зимни курорти, както и да видите картина от камерите на пистите.

Сега цялата информация от Sinoptik.bg е достъпна за вас навсякъде, където и да сте и по всяко време, чрез мобилното ни приложение за iOS - iPhone и iPad.

Някои от любимите ни функционалности:
- „Усеща се като“ температурна стойност;
- Синхрон между фоново изображение и състояние на времето в момента;
- Почасова прогноза за следващите 24 ч., с конкретни детайли за всеки час;
- Детайлна 10-дневна прогноза;
- Бърз достъп до любими локации;
- Ски условия в големите български зимни курорти;
- Картина от камери на пистите;
- Състояние на пистите и съоръженията;
- Карти на пистите;

Как да използвате приложението:
- Плъзнете екрана нагоре, за да видите детайли за времето в момента;
- Плъзнете екрана наляво, за да преминете на 24-часова или 10-дневна прогноза;
- Добавете любима локация чрез символа + в горния десен ъгъл;
- Натиснете името на града за бързо превключване между любими локации;
- За детайли за конкретен ден или час - натиснете върху конкретния ред;
- За да пуснете камера от конкретна местност, натиснете върху реда или малката камера вдясно;
- Изкарайте пълното меню от символа в горния ляв ъгъл;

Infoclimat is the official application of the french organization, pioneer in real-time weather in France since 1999. This app offers for free, without advertising, complete information about weather :
- check our high resolution maps for official live weather data around the world (over 10,000 stations), and consult detailed information on tables and charts;
- be alerted in case of weather warning near your position, in case of observed or planned severe weather (lightning, heavy rain, strong winds…) around you in the next hours, or when a station reach a threshold;
- consult our satellite images, precipitation radar & lightning around you;
- take part in our community by sending your pictures & information about weather phenomena, and consult other users' reports.
- all European information about weather, written by our enthusiasts : weather monitoring, forecasts, daily summaries…
- find panoramas around you to observe and photograph thunderstorms, with our Storm Chasing feature;
- check out forecasts, observation and alerts at a glance thanks to our complete homepage;
- do your own forecasts by using charts from global (GFS, GEFS), and regional high-resolution (WRF, AROME) models ! You can also view detailed forecasts up to 7 days, ensemble forecasts…
Infoclimat is a non-profit organization, composed of volunteers who's been working for many years to promote access to weather data. This application is offered for free thanks to the support of our partners and members of the organization.
About permissions: geolocation is used only to provide you weather data around your position : that information will be used only for this purpose. You can disable this feature if you want.
